import {Redirect} from "react-router-dom";

const ProtectedRoute = ({ Component, isLoggedIn, ...props }) => {
    return isLoggedIn ? (
        <Component {...props} />
    ) : (
        <Redirect to="/sign-in" />
    );
};

export default ProtectedRoute
